export const url = "http://localhost:8080";

export const loginInputs = {
  inputs: [
    {
      label: "Email Address",
      name: "email",
      type: "email",
      placeholder: "Enter a valid email address",
    },
    {
      label: "Password",
      name: "password",
      type: "password",
      placeholder: "Enter Password",
    },
  ],
};

export const signupInputs = {
  inputs: [
    {
      label: "Email Address",
      name: "email",
      type: "email",
      placeholder: "Enter a valid email address",
    },
    {
      label: "Contact No.",
      name: "contact",
      type: "text",
      placeholder: "Enter contact no.",
    },
    {
      label: "Password",
      name: "password",
      type: "password",
      placeholder: "Enter Password",
    },
  ],
};

export const forgotPasswordInputs = {
  inputs: [
    {
      label: "Email Address",
      name: "email",
      type: "email",
      placeholder: "Enter a valid email address",
    },
    {
      label: "Password",
      name: "password",
      type: "password",
      placeholder: "Enter Password",
    },
    {
      label: "Confirm Password",
      name: "confirmPassword",
      type: "password",
      placeholder: "Confirm Password",
    },
  ],
};

export const partyRegistration = {
  inputs: [
    {
      label: "Party Name",
      name: "politicalPartyName",
      type: "Text",
      placeholder: "Enter party name",
    },
    {
      label: "President Name",
      name: "presidentName",
      type: "Text",
      placeholder: "Enter president name",
    },
    {
      label: "State",
      name: "state",
      type: "Text",
      placeholder: "Enter state",
    },
    {
      label: "District",
      name: "district",
      type: "Text",
      placeholder: "Enter district",
    },
    {
      label: "Party Symbol",
      name: "partySymbol",
      type: "file",
      placeholder: "",
    },
    {
      label: "Party address",
      name: "politicalPartyAddress",
      type: "text",
      placeholder: "Enter party address",
    },
  ],
};

export const registerCandidateAssembly = {
  inputs: [
    {
      label: "Voter Id",
      name: "voterId",
      type: "text",
      placeholder: "Please enter your voter id",
    },
    {
      label: "Assembly",
      name: "assemblyId",
      type: "text",
      placeholder: "Please enter assembly id, you want to contest",
    },
    {
      label: "Political Party",
      name: "politicalParyId",
      type: "text",
      placeholder: "Please enter political party id, you want to contest",
    },
    {
      label: "Election",
      name: "electionId",
      type: "text",
      placeholder: "Please enter election id, for which you want to contest",
    },
    {
      label: "Criminal Details",
      name: "criminalDetails",
      type: "text",
      placeholder: "Enter criminal details, if not type 'No'",
    },
    {
      label: "Income Details",
      name: "incomeDetails",
      type: "text",
      placeholder: "Enter your income details",
    },
  ],
};

export const RegisterCandidateParliament = {
